import React from "react";
// import "./Home.css"

const Home = () => {
  const todayDate = () => {
    const date = new Date();
    var d = new Date(date),
      month = "" + (d.getMonth() + 1),
      day = "" + d.getDate(),
      year = d.getFullYear();

    if (month.length < 2) month = "0" + month;
    if (day.length < 2) day = "0" + day;

    return [year, month, day].join("-");
  };
  return (
    <div id="home">
      Welcome to Home!
      <br />
      {todayDate()};
    </div>
  );
};

export default Home;
